      shippedInBox: true,
      href: "/product/1",
      img: "/tulips.jpg",
      imgAlt: "Full of Joy™ Bouquet",
    },
    {
      title: "Full of Joy™ Bouquet",
      salePrice: "$50 - $67.50",
      oldPrice: "$50 - $75",
      price: "$42 - $44",
      shippedInBox: true,
      href: "/product/1",
      img: "/tulips.jpg",
      imgAlt: "Full of Joy™ Bouquet",
    },
    
  ];
  return <ProductList title={"New Spring Flowers"} items={items}></ProductList>;
}
